import React from 'react';
import Todo from './todo'
const { useState } = React;
const TodoList = (props) => {
    let [newTodo, setNewTodo] = useState("");
    let todos = [
        {
            name: "Learn React"
        }
    ]
    return(
        <div>

            {
                todos.map(todo => (
                    <Todo {...todo}/>
                ))
            }
        </div>
    );
}

export default TodoList;
